import { Routes, Route } from 'react-router-dom';
import App from './layouts/App';
import AuthPage from './pages/AuthPage';
import ProfilePage from './pages/ProfilePage';
import Catalog from './catalog/CatalogPage'; // Добавьте свои страницы
import Ipoteka from './Ipoteka/Ipotekapoteka';
import Header from './layouts/Header';
import About from './layouts/About';
import Apartments from './layouts/Apartments';
import Cta from './layouts/Cta';
import VideoFile from './layouts/VideoFile';
import Map from './layouts/Map';
import Feedback from './layouts/Feedback';
import Footer from './layouts/Footer';
import Main from './layouts/Main';
import ContactsPage from './pages/ContactsPage';
import NotFoundPage from './pages/NotFoundPage';

export default function AppRoutes() {
  return (
    <Routes>
      {/* Главный макет со вложенными маршрутами */}
      <Route path="/" element={<App />}>
        {/* Вложенные маршруты */}
        <Route index element={<MainContent />} /> // Главная страница
        <Route path="catalog" element={<CatalogPage />} />
        <Route path="contacts" element={<ContactsPage />} />
        <Route path="profile" element={<ProfilePage />} />
      </Route>
      
      {/* Отдельные маршруты */}
      <Route path="/auth" element={<AuthPage />} />
      
      {/* Обработка 404 */}
      <Route path="*" element={<NotFoundPage />} />
    </Routes>
  );
}

function MainContent() {
  return (
    <>
      <Header />
      <Main />
      <About />
      <Apartments />
      <Cta />
      <VideoFile />
      <Map />
      <Feedback />
      <Footer />
    </>
  );
}
